import React, { Component } from 'react';

import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from 'react-responsive-carousel';
import './Slider.css'

export default class Slider extends Component {
  render() {
    return(
     <>
       <Carousel autoPlay>
                    <div>
                        <img src="https://picsum.photos/700/400?img=1" alt='img'/>

                    </div>
                    <div>
                        <img src="https://picsum.photos/700/400?img=2" alt='img'/>

                    </div>
                    <div>
                        <img src="https://picsum.photos/700/400?img=3" alt='img'/>

                    </div>
                </Carousel>
     </>);
  }
}
